INSERT INTO `movie` VALUES (1,'Spider-Man: Across the Spider-Verse','Action','02:20:00','Spider-Man Across the Spider-Verse.jpg','Traveling across the multiverse, Miles Morales meets a new team of Spider-People, made up of heroes from different dimensions. But when the heroes clash over how to deal with a new threat, Miles finds himself at a crossroads.','End Showing'),(2,'Deadpool & Wolverine','Action','02:08:00','Deadpool & Wolverine.png','Deadpool is offered a place in the Marvel Cinematic Universe by the Time Variance Authority, but instead recruits a variant of Wolverine to save his universe from extinction.','End Showing'),(3,'Interstellar','Fantasy','02:49:00','Interstellar.jpg','When Earth becomes uninhabitable in the future, a farmer and ex-NASA pilot, Joseph Cooper, is tasked to pilot a spacecraft, along with a team of researchers, to find a new planet for humans.\n','End Showing'),(4,'The Garfield Movie','Comedy','01:41:00','The Garfield Movie.jpg','After Garfield\'s unexpected reunion with his long-lost father, ragged alley cat Vic, he and his canine friend Odie are forced from their perfectly pampered lives to join Vic on a risky heist.\n','End Showing'),(5,'Oppenheimer','Action','03:00:00','Oppenheimer.jpg','A dramatization of the life story of J. Robert Oppenheimer, the physicist who had a large hand in the development of the atomic bombs that brought an end to World War II.','End Showing'),(6,'Venom: The Last Dance','Action','01:51:00','synopsis_poster.png','Eddie Brock and Venom must make a devastating decision as they\'re pursued by a mysterious military man and alien monsters from Venom\'s home world.\n','End Showing'),(7,'Ne Zha 2','Action','02:23:00','Ne Zha 2.jpg','After the catastrophe, although the souls of Nezha and Aobing were saved, their bodies would soon be shattered. Taiyi Zhenren planned to use the seven-colored lotus to rebuild their bodies.\n','End Showing'),(8,'Moana 2','Action','01:40:00','Moana 2.jpg','After receiving an unexpected call from her wayfinding ancestors, Moana must journey to the far seas of Oceania and into dangerous, long-lost waters for an adventure unlike anything she\'s ever faced.','End Showing'),(9,'Dune: Part Two','Action','02:46:00','Dune Part Two.jpg','Paul Atreides unites with the Fremen while on a warpath of revenge against the conspirators who destroyed his family. Facing a choice between the love of his life and the fate of the universe, he endeavors to prevent a terrible future.','End Showing'),(10,'Red One','Fantasy','02:03:00','Red One.jpg','After Santa Claus is kidnapped, the North Pole\'s Head of Security must team up with a notorious hacker in a globe-trotting, action-packed mission to save Christmas.','End Showing'),(11,'Black Bag','Action','01:33:00','Black Bag.jpg','When intelligence agent Kathryn Woodhouse is suspected of betraying the nation, her husband - also a legendary agent - faces the ultimate test of whether to be loyal to his marriage, or his country.','End Showing'),(12,'O\'Dessa','Romance','01:46:00','O_dessa.jpg','A farm girl in search to recover a cherished family heirloom. She travels to a strange and dangerous city where she meets her one true love. To save his soul, she must put the power of destiny to the ultimate test.','End Showing'),(13,'The Alto Knights','Action','02:03:00','The Alto Knight.jpg','Two of New York City\'s most notorious organized crime bosses vie for control of the city\'s streets. Once best friends, petty jealousies and a series of betrayals set them on a deadly collision course.','End Showing'),(14,'Heretic','Horror','01:51:00','Heretic.jpg','Two young religious women are drawn into a game of cat-and-mouse in the house of a strange man.','End Showing'),(15,'Novocaine','Comedy','01:50:00','Novocaine.jpg','When the girl of his dreams is kidnapped, a man incapable of feeling physical pain turns his rare condition into an unexpected advantage in the fight to rescue her.','End Showing'),(16,'Last Breath','Action','01:32:00','Last Breath.jpg','A true story that follows seasoned deep-sea divers as they battle the raging elements to rescue their crew mate trapped hundreds of feet below the ocean\'s surface.','End Showing'),(17,'The Brutalist','Action','03:36:00','The Brutalist.jpg','When a visionary architect and his wife flee post-war Europe in 1947 to rebuild their legacy and witness the birth of modern United States, their lives are changed forever by a mysterious, wealthy client.','End Showing'),(18,'Better Man','Action','02:15:00','Better Man.jpg','The meteoric rise, dramatic fall, and remarkable resurgence of British pop superstar Robbie Williams.','End Showing'),(19,'The Dark Knight','Action','02:31:00','The Dark Knight.jpg','When a menace known as the Joker wreaks havoc and chaos on the people of Gotham, Batman, James Gordon and Harvey Dent must work together to put an end to the madness.','End Showing'),(20,'Den of Thieves: Pantera','Action','02:24:00','Den of Thieves 2-Pantera.jpg','Big Nick is back on the hunt in Europe and closing in on Donnie, who is embroiled in the treacherous world of diamond thieves and the infamous Panther mafia, as they plot a massive heist of the world\'s largest diamond exchange.','End Showing'),(21,'A Complete Unknown','Action','02:21:00','A Complete Unknown.jpg','In 1961, an unknown 19-year-old Bob Dylan arrives in New York City with his guitar and forges relationships with musical icons on his meteoric rise, culminating in a groundbreaking performance that reverberates around the world.','End Showing'),(22,'Woman In The Yard','Horror','01:28:00','Woman In The Yard.jpg','A mysterious woman repeatedly appears in a family\'s front yard, often delivering chilling warnings and unsettling messages, leaving them to question her identity, motives and the potential danger she might pose.','End Showing'),(23,'Thunderbolts','Action','02:06:00','Thunderbolts.jpg','After finding themselves ensnared in a death trap, an unconventional team of antiheroes must embark on a dangerous mission that will force them to confront the darkest corners of their pasts.','End Showing'),(24,'Clown In The Cornfield','Horror','01:37:00','Clown In The Cornfield.jpg','A fading midwestern town in which Frendo the clown, a symbol of bygone success, reemerges as a terrifying scourge.','End Showing'),(25,'Popeye: The Slayer Man','Horror','01:28:00','Popeye The Slayer Man.jpg','A curious group of friends sneak into an abandoned spinach canning factory to investigate the legend of the \"Sailor Man,\" who is said to haunt the factory and local docks.','End Showing'),(26,'Twisters','Action','02:02:00','Twisters.jpg','Kate Carter, a retired tornado-chaser and meteorologist, is persuaded to return to Oklahoma to work with a new team and new technologies.','End Showing'),(27,'Conclave','Action','02:00:00','Conclave.jpg','When Cardinal Lawrence is tasked with leading one of the world\'s most secretive and ancient events, selecting a new Pope, he finds himself at the center of a web of conspiracies and intrigue that could shake the very foundation of the Catholic Church.','End Showing'),(28,'Holland','Horror','01:50:00','Holland.jpg','A woman\'s picture-perfect life in quaint Holland, Michigan crumbles, when she and a friend uncover a twisted secret in their midst.','End Showing'),(29,'No Hard Feelings','Romance','01:43:00','No Hard Feelings.jpg','On the brink of losing her home, Maddie finds an intriguing job listing: helicopter parents looking for someone to bring their introverted 19-year-old son out of his shell before college. She has one summer to make him a man or die trying.','End Showing'),(30,'The Day The Earth Blew Up:A Looney Tunes Movie','Comedy','01:33:00','The Day The Rarth Blew Up-A Looney Tunes Movie.jpg','Porky Pig and Daffy Duck are Earth\'s only hope when facing the threat of alien invasion.','End Showing'),(31,'Tom And Jerry:The Fast And The Furry','Comedy','01:15:00','Tom And Jerry-The Fast And The Furry.jpg','After wrecking their house during a chase, Tom and Jerry enter a race around the world where the winner gets a new fancy house.','End Showing'),(32,'Carjackers','Action','01:37:00','Carjackers.jpg','Nora is a valet driver; with Zo, Steve and Prestance, her colleagues and friends, she has set up the Carjackers team. By day, they serve wealthy clients in palaces, but when they\'re not working, they rob those whose evil deeds they know.','End Showing'),(33,'I\'m Still Here','Action','02:17:00','I_m Still Here.jpg','A woman married to a former politician during the military dictatorship in Brazil is forced to reinvent herself and chart a new course for her family after a violent and arbitrary act.','End Showing'),(34,'No Other Land','Action','01:32:00','No Other Land.jpg','This film made by a Palestinian-Israeli collective shows the destruction of the occupied West Bank\'s Masafer Yatta by Israeli soldiers and the alliance which develops between the Palestinian activist Basel and Israeli journalist Yuval.','End Showing'),(35,'The Actor','Romance','01:38:00','The Actor.jpg','When New York actor Paul Cole is beaten and left for dead in 1950s Ohio, he loses his memory and finds himself stranded in a mysterious small town where he struggles to get back home and reclaim what he\'s lost.','End Showing'),(36,'The Life List','Romance','01:03:00','The Life List.jpg','A woman revisits her childhood aspirations, endeavoring to achieve her old goals, only to discover that pursuing these lifelong dreams takes her on an unforeseen and surprising journey.','End Showing'),(37,'A Knight\'s War','Action','01:35:00','A Knight_s War.jpg','A fearless knight braves a deadly realm to save the Chosen One\'s soul. Facing witches, demons, and brutal foes, he discovers her return could ignite chaos and doom humanity.','End Showing'),(38,'Revelations','Action','02:02:00','Revelations.jpg','A pastor and a detective, driven by their beliefs, pursue a missing person case, with the pastor seeking retribution after a divine revelation identifies the culprit who abducted his son.','End Showing'),(39,'Riff Raff','Comedy','01:43:00','Riff Raff.jpg','A former criminal\'s ordinary life is turned upside down when his old family shows up for a long-awaited reunion.','End Showing'),(40,'LA LA LAND','Romance','02:08:00','La La Land.jpg','When Sebastian, a pianist, and Mia, an actress, follow their passion and achieve success in their respective fields, they find themselves torn between their love for each other and their careers.','End Showing'),(41,'Mickey 17','Action','02:17:00','Mickey 17.jpg','Mickey 17 is an \"expendable\", a disposable employee on a human expedition sent to colonise the ice world Niflheim. After one iteration of Mickey dies, a new body is regenerated with most of his memories intact.','End Showing'),(42,'Flow','Fantasy','01:24:00','Flow.jpg','The world seems to be coming to an end, teeming with the vestiges of a human presence.','End Showing'),(43,'MINECRAFT Movie','Fantasy','01:40:00','minecraft.jpg','The malevolent Ender Dragon sets out on a path of destruction, prompting a young girl and her group of unlikely adventurers to set out to save the Overworld.\n','End Showing'),(44,'A REAL PAIN','Comedy','01:30:00','ARealPain.jpg','Mismatched cousins reunite for a tour through Poland to honor their beloved grandmother, but their old tensions resurface against the backdrop of their family history.','End Showing'),(45,'Snow White','Fantasy','01:49:00','snow_white.jpg','Live-action adaptation of the 1937 Disney animated film \'Snow White and the Seven Dwarfs\'.','End Showing'),(46,'The Monkey','Horror','01:38:00','TheMonkey.jpg','When twin brothers Bill and Hal find their father\'s old monkey toy in the attic, a series of gruesome deaths start. The siblings decide to throw the toy away and move on with their lives, growing apart over the years.','End Showing'),(47,'Companion','Horror','01:37:00','Companion.jpg','During a weekend getaway at a secluded lakeside estate, a group of friends finds themselves entangled in a web of secrets, deception, and advanced technology.','End Showing'),(48,'Panda Plan','Comedy','01:39:00','Panda_Plan.jpg','An international action superstar and his assistant are involved in a transnational rescue operation of the mysterious protagonist P, the top international superstar.','End Showing'),(49,'Captain America: Brave New World','Action','01:59:00','CaptainAmericaBraveNewWorld.jpg','Sam Wilson, the new Captain America, finds himself in the middle of an international incident and must discover the motive behind a nefarious global plan.','End Showing'),(50,'A Working Man','Action','01:56:00','A Working Man.jpg','Levon Cade left his profession behind to work construction and be a good dad to his daughter. But when a local girl vanishes, he\'s asked to return to the skills that made him a mythic figure in the shadowy world of counter-terrorism.','End Showing'),(51,'Detective Chinatown 1900','Action','02:16:00','DetectiveChinatown1900.jpg','In 1900s San Francisco, a white woman is murdered in Chinatown and the suspect is a Chinese man. The murder causes a social shock and the public calls for Chinatown to be outlawed.','End Showing'),(52,'Karate Kid: Legends','Action','01:49:00','KarateKidLegends.jpg','Li is a skilled fighter and a student in Beijing who has his life uprooted when his mom decides that they\'re moving to Brooklyn for a work opportunity.','End Showing'),(53,'The Bad Guys 2','Action','02:09:00','TheBadGuys2.jpg','The Bad Guys are struggling to find trust and acceptance in their newly minted lives as Good Guys, when they are pulled out of retirement and forced to do \'one last job\' by an all-female squad of criminals.','End Showing'),(54,'How To Train Your Dragon','Action','01:36:00','How To train your dragon.jpg','Follows a young Viking as he aspires to hunt dragons, and how he becomes unexpectedly a friend of a young dragon.','Upcoming'),(55,'Jurassic World Rebirth','Action','02:19:00','Jurassic_World_Rebirth.jpg','Five years post-Jurassic World Dominion, an expedition braves isolated equatorial regions to extract DNA from three massive prehistoric creatures for a groundbreaking medical breakthrough.','Upcoming'),(56,'Avengers: Doomsday','Action','01:35:00','AvengersDoomsday.jpg','Plot undefined.','End Showing'),(57,'Bright Sky','Romance','01:25:00','Bright.jpg','A single mother escapes a dark past to a small town. As she begins to build a new life, she comes across an outlaw looking for redemption.','End Showing'),(58,'Avatar Fire and Ash','Fantasy','03:12:00','Avatar Fire And Ash.jpg','Jake and Neytiri\'s family grapples with grief after Neteyam\'s death, encountering a new, aggressive Na\'vi tribe, the Ash People, who are led by the fiery Varang, as the conflict on Pandora escalates and a new moral focus emerges.','Upcoming'),(59,'Home Sweet Home Rebirth','Horror','01:33:00','Home Sweet Home-Rebirth.jpg','When a city is overrun with a demonically-possessed crowd, a cop must find the source of evil to save his family.','End Showing'),(60,'28 Years Later','Horror','02:06:00','28 Years Later.jpg','A group of survivors of the rage virus lives on a small island. When one of the group leaves the island on a mission into the mainland, he discovers secrets, wonders, and horrors that have mutated not only the infected but other survivors.','End Showing'),(61,'The Amateur','Action','02:02:00','The Amateur.jpg','When his supervisors at the CIA refuse to take action after his wife is killed in a London terrorist attack, a decoder takes matters into his own hands.','End Showing'),(62,'In the Lost Land','Action','01:41:00','In the Lost Lands.jpg','A queen sends the powerful and feared sorceress Gray Alys to the ghostly wilderness of the Lost Lands in search of a magical power, where the sorceress and her guide, the drifter Boyce, must outwit and outfight man and demon.','End Showing'),(63,'The Fantastic Four First Steps','Action','02:34:00','The Fantastic Four First Steps.jpg','Forced to balance their roles as heroes with the strength of their family bond, the Fantastic Four must defend Earth from a ravenous space god called Galactus and his enigmatic Herald, Silver Surfer.','End Showing'),(79,'Kraven The Hunter','Action','02:07:00','Kraven The Hunter.png','-Kraven\'s complex relationship with his ruthless father, Nikolai Kravinoff, starts him down a path of vengeance with brutal consequences, motivating him to become not only the greatest hunter in the world, but also one of its most feared.\n','Upcoming'),(80,'Final Destination','Horror','02:00:00','photo_2025-05-08_07-59-27.jpg','IMAX unveils the official movie poster of \"Final Destination: Bloodlines,\" which will hit Philippines theaters on May 14','Upcoming'),(81,'I CAME BY','Horror','02:07:00','photo_2025-05-08_08-06-18.jpg','A true story that follows seasoned deep-sea divers as they battle the raging elements to rescue their crew mate trapped hundreds of feet below the ocean\'s surface','Showing'),(82,'Me Before You','Romance','02:00:00','photo_2025-05-08_08-06-07.jpg','When intelligence agent Kathryn Woodhouse is suspected of betraying the nation, her husband - also a legendary agent - faces the ultimate test of whether to be loyal to his marriage, or his country.\n','Showing'),(83,'Ballerina','Action','02:00:00','photo_2025-05-08_08-06-02.jpg','When the girl of his dreams is kidnapped, a man incapable of feeling physical pain turns his rare condition into an unexpected advantage in the fight to rescue her','Showing'),(84,'FALL','Horror','02:00:00','photo_2025-05-08_08-05-45.jpg','Kraven\'s complex relationship with his ruthless father, Nikolai Kravinoff, starts him down a path of vengeance with brutal consequences, motivating him to become not only the greatest hunter in the world, but also one of its most feared.\n','Showing'),(85,'Break','Horror','02:00:00','photo_2025-05-08_08-05-35.jpg','-When a visionary architect and his wife flee post-war Europe in 1947 to rebuild their legacy and witness the birth of modern United States, their lives are changed forever by a mysterious, wealthy client.','Showing');
